This is a canvas with a balance of colors and shapes. It depicts an abstract landscape of another planet. The letter that appears in some iterations comes from this NFT hash. At the right top corner you can get features.

Features:

Palette: one of 10 palettes;
Shape1: 'spaceship', 'planet' or 'none' – the rectangle or circle above;
Shape2: 'iceberg', 'mountain, 'none';
SpacePattern: 'laser', 'stars', 'none' – cosmos pattern;
Waves: the waves at the water;
Transport: from 0 to 2 – I'm bet someone use them as a transport;
Letter: One of the letter from yours NFT hash
Clouds: has clouds or not, was used font and symbol ☁
Background Pattern: 'circle', '+', 'lines' or 'none'
Monochrome: is pallet is monochrome, makes all monochrome
Framed: has the tiny frame or not.

Direction determination refers to the ways in which a cardinal direction can be determined in navigation and wayfinding. The most direct method is using a compass, but indirect methods exist, based on the sun, the moon, the stars. It helped humans to explore the world as we know it.

---------------------------------------------------------------

'Cardinal directions' is inspired by minimalism and express natural human predisposition to explore the world. Our curiosity led as to where we are now. We explored the nature that surrounds us and were able to adapt to various circumstances. We overcome difficulties and used it to our favor.

---------------------------------------------------------------

The collection consists of 4 different geographical areas - mountains, woods, seas and plains. Each area has its own unique element - a monument created by humans as a symbol of how we adapt in different places.

---------------------------------------------------------------

Geographical areas: Mountains, Woods, Seas, Plains;
Monuments: Castles, Watch Towers, Lighthouses, Windmills;
Daytime: Day, Night;
Moon phase: Full, Waxing, Waning;
Weather: Dusky, Cloudy, Clear;
Sky objects: Stars, Shooting Star, Birds;
Legendary creature: Sea Snake (Rare).

---------------------------------------------------------------

Resolution: 2000x2000 px
Press [s] to download the piece as a png file

